import MainStore from "../stores/MainStore";

//import CADASTRAR_USUARIO from 'app/actions/CadastroActions';

const initialState = {
    usuario: null
};

const cadastro = (state = initialState, action) => {
    if(!action.usuario) return state;
    console.log(MainStore.getState()) 
    return state;
};

export default cadastro;
